                {{ utSimpleVersion(access_item.ua_info.browser.version, 2) }}
              </span>
            </div>
          </td>

          <!-- UA Device and OS -->
          <td class="td-collapsing">
            <span class="icon-sys align-middle" :class="[get_os_icon_class(access_item.ua_info.os.name)]"></span>
            <div class="d-inline-block align-middle">
