                </span>
              </span>
            </div>
          </td>

          <!-- Screen Resolution Name, Resolution Size, View Percent -->
          <td class="td-collapsing"
              :title="`Screen: ${access_item.screen_width}x${access_item.screen_height}\nBrowserInner: ${access_item.browser_inner_width}x${access_item.browser_inner_height}\nBrowserOuter: ${access_item.browser_outer_width}x${access_item.browser_outer_height}`">
            {{ (access_item.res_info=utResolutionName(access_item.screen_width, access_item.screen_height)).name.substr(0) }}
