<script>

import {utGetFlagEmoji, utTextDurationTimeHMS, utTextTimeYMD, utTextTimeHMAPM,
  utHexColorHashString, utParseUA, utSimpleVersion, utResolutionName} from "../../ut_parse.js";

import {request} from "../../main";



export default {
  name: "AccessTable",
  props: {site_id: Number},
  data() {return {
    access_list: [],
    search_params: {
      ip_address: "",
      url: "",
      useragent: "",
      browser_timezone: "",
      browser_language: ""
    },
    AccessProperties: [
      {name: "Access ID",  val(accitm) {return accitm.access_id;} },
      {name: "Time",       val(accitm) {return utTextTimeYMD(accitm.time) + " | " + utTextTimeHMAPM(accitm.time, true);} },
      {name: "IP Address", val(ai) {
        let ipi = ai.ip_info;

        return `${ipi.ip} :: ${ipi.country}<sup>${ipi.country_code}</sup> ${ipi.region}<sup>${ipi.region_code}</sup> ${ipi.city}<sup>(${ipi.lat}, ${ipi.lon})</sup> via ${ipi.isp}`;} },
      {name: "Browser Cookie ID", val(accitm) {return accitm.browser_cookie_uid;} },
      {name: "Browser Vendor", val(accitm) {return accitm.browser_vendor;} },
      {name: "Browser Timezone", val(accitm) {return accitm.browser_timezone;} },
      {name: "Browser Language", val(accitm) {return "["+accitm.browser_language+"] "+accitm.browser_languages;} },
      {name: "Device Platform", val(accitm) {return accitm.device_platform;} },
      {name: "User Agent", val(accitm) {return accitm.user_agent;} },
      {name: "Screen", val(ai) {
        let n = utResolutionName(ai.screen_width, ai.screen_height);
        return `${ai.screen_width}x${ai.screen_height} ${ai.screen_bits}bits / ${n.std_name} ${n.name}`;} },
      {name: "Browser Size", val(ai) {
        let s = ai.screen_width * ai.screen_height,
            wo = ai.browser_outer_width * ai.browser_outer_height,
            wi = ai.browser_inner_width * ai.browser_inner_height;
        let inn_out = ai.browser_inner_width+"x"+ai.browser_inner_height+" ← "+ai.browser_outer_width+"x"+ai.browser_outer_width;
        let ratios = (wi/s).toFixed(2)+" : "+(wo/s).toFixed(2)+" : 1";
        return `<span title="Inner ← Outer">${inn_out}</span> | <span title="Inner : Outer : Screen">${ratios}</span>`;} },
      {name: "Page", val(a) {return `"${a.window_title}" <br> ${a.window_url}`;} },
      {name: "Referrer", val(a) {return a.window_referrer ? a.window_referrer : "<i>NIL</i>";} },
    ]
  }},
  methods: {
    request_access_list() {
      this.$refs.btn_search.classList.add("loading");
      request("/access_list", {
        site_id: this.site_id,
        search_params: this.search_params
      }, resp => {
        this.access_list = resp;
        this.$refs.btn_search.classList.remove("loading");
      });
    },

    utGetFlagEmoji,
    utTextDurationTimeHMS,
    utTextTimeYMD,
    utTextTimeHMAPM,
    utHexColorHashString,
    utParseUA,
    utSimpleVersion,
    utResolutionName,
    get_browser_icon_class(name) {
      switch (name) {
        case "Chrome": return "icon-chrome";
        case "Chromium": return "icon-chromium";
        case "Firefox": return "icon-firefox";
        case "IE": return "icon-ie";
        case "Safari": return "icon-safari";
        case "Edge": return "icon-edge";
        case "Opera": return "icon-opera";
        case "Robot": return "icon-robot";
        default: return "icon-unknown";
      }
    },
    get_os_icon_class(name) {
      switch (name) {
        case "Linux": return "icon-linux";
        case "MacOSX": return "icon-osx";
        case "Win2000": return "icon-winxp";
        case "WinXP": return "icon-winxp";
        case "WinVista": return "icon-winvista";
        case "Win7": return "icon-win7";
        case "Win8": return "icon-win10";
        case "Win8.1": return "icon-win10"; //"icon-win81";
        case "Win10": return "icon-win10";
        case "Windows Phone": return "icon-win10";
        case "iOS": return "icon-ios";
        case "Android": return "icon-android";
        case "Robot": return "icon-robot";
        default: return "icon-unknown";
      }
    },
    toggle_detail_display(detailbox, btn) {
      let icon = btn.firstChild;

      if (detailbox.style.display !== "none") {
        detailbox.style.display = "none";
        icon.style.transform = "none";
      } else {
        detailbox.style.display = "table-row";
        icon.style.transform = "rotate(180deg)";
      }
    },
  },
  mounted() {

    this.request_access_list();
  }
}
</script>

